const input = $input.all().map(item => item.json);

// Normalize and test against known patterns
function isTOC(title) {
  if (!title || typeof title !== 'string') return false;

  const normalized = title
    .toLowerCase()
    .replace(/[^a-z0-9]/g, ' ') // replace punctuation with space
    .replace(/\s+/g, ' ')       // collapse spaces
    .trim();

  const tocKeywords = [
    'table of contents',
    'table of content',
    'contents',
    'toc'
  ];

  return tocKeywords.some(keyword => normalized.includes(keyword));
}

// Filter out chunks where the title suggests it's TOC
const filtered = input.filter(chunk => {
  const title = chunk.section_title || chunk.text || '';
  return !isTOC(title);
});

return filtered.map(chunk => ({ json: chunk }));

/**
 * Sanitizes chunk text to ensure compatibility with Nomic embedding API
 * This function deals with "smart" characters, quotes, and other problematic elements
 * Preserves existing chunk_index values
 * 
 * @returns {Array} - The processed items
 */
function sanitizeChunksForEmbedding() {
  // Get input data
  const items = $input.all();
  const outputItems = [];

  // Process each item
  for (const item of items) {
    // Handle different possible input formats
    let chunks;

    if (Array.isArray(item.json)) {
      // If item.json is already an array of chunks
      chunks = item.json;
    } else if (item.json.chunks && Array.isArray(item.json.chunks)) {
      // If chunks are in a property called 'chunks'
      chunks = item.json.chunks;
    } else {
      // If the item itself is a single chunk
      chunks = [item.json];
    }

    // Track chunk indices per section for chunks without existing chunk_index
    const sectionIndices = {};

    // Sanitize each chunk
    const sanitizedChunks = chunks.map(chunk => {
      // Create a new object to avoid modifying the original
      const sanitizedChunk = { ...chunk };

      // Sanitize the main text field if it exists
      if (sanitizedChunk.text) {
        sanitizedChunk.text = sanitizeText(sanitizedChunk.text);
      }

      // Sanitize the embedding text field if it exists
      if (sanitizedChunk.text_to_embed) {
        sanitizedChunk.text_to_embed = sanitizeText(sanitizedChunk.text_to_embed);
      }

      // Sanitize section title if it exists
      if (sanitizedChunk.section_title) {
        sanitizedChunk.section_title = sanitizeText(sanitizedChunk.section_title);
      }

      // Ensure vector_metadata exists
      if (!sanitizedChunk.vector_metadata) {
        sanitizedChunk.vector_metadata = {};
      }

      // IMPORTANT CHANGE: Only set chunk_index if it doesn't already exist
      if (sanitizedChunk.vector_metadata.chunk_index === undefined) {
        // Initialize or get the current section's index tracker
        const sectionKey = sanitizedChunk.section_title || 'default';
        if (sectionIndices[sectionKey] === undefined) {
          sectionIndices[sectionKey] = 0;
        }

        // Populate chunk_index in vector_metadata
        sanitizedChunk.vector_metadata.chunk_index = sectionIndices[sectionKey];

        // If this is a split chunk and already has part_index, don't increment the section index
        // Otherwise, increment for the next chunk with the same section
        if (!sanitizedChunk.vector_metadata.is_split || 
            (sanitizedChunk.vector_metadata.is_split && sanitizedChunk.vector_metadata.part_index === 0)) {
          sectionIndices[sectionKey]++;
        }
      }

      return sanitizedChunk;
    });

    // Return in the same format as received
    if (Array.isArray(item.json)) {
      outputItems.push({ json: sanitizedChunks });
    } else if (item.json.chunks && Array.isArray(item.json.chunks)) {
      outputItems.push({
        json: {
          ...item.json,
          chunks: sanitizedChunks
        }
      });
    } else {
      // Return processed single chunk
      outputItems.push({ json: sanitizedChunks[0] });
    }
  }

  return outputItems;
}

/**
 * Sanitizes text by replacing special characters and ensuring JSON compatibility
 * @param {string} text - Text to sanitize
 * @returns {string} - Sanitized text
 */
function sanitizeText(text) {
  if (!text) return '';

  // Remove wrapping quotes if present
  let sanitized = text;
  if ((text.startsWith('"') && text.endsWith('"')) || 
      (text.startsWith('"') && text.endsWith('"'))) {
    sanitized = text.substring(1, text.length - 1);
  }

 // Replace smart/curly quotes with straight quotes
  sanitized = sanitized
    .replace(/[\u2018\u2019]/g, "'") // Replace single smart quotes
    .replace(/[\u201C\u201D]/g, '"') // Replace double smart quotes

    // Remove invisible control characters
    .replace(/[\u0000-\u001F\u007F-\u009F\u2000-\u200F\u2028-\u202F]/g, ' ')

    // Replace other problematic characters
    .replace(/[\u2013\u2014]/g, '-') // Replace em dash and en dash
    .replace(/\u2026/g, '...') // Replace ellipsis
    .replace(/\u00A0/g, ' ') // Replace non-breaking space

    // Special handling for bullet points and other list markers
    .replace(/[\u2022\u2023\u25E6\u2043\u2219]/g, '*') // Convert bullets to asterisks

    // Normalize whitespace (remove multiple spaces, tabs, etc.)
    .replace(/\s+/g, ' ')
    // Trim leading and trailing whitespace
    .replace(/"/g, '\\"')
    // Handle other special characters that might cause issues in JSON
    //.replace(/\\/g, '\\\\')
    .replace(/\f/g, '\\f')
    .replace(/\n/g, '\\n')
    .replace(/\r/g, '\\r')
    .replace(/\t/g, '\\t')
    .trim();

  return sanitized;
}

// Execute the function and return the result
return sanitizeChunksForEmbedding();

// n8n Function node
// Filters out empty / duplicate chunks and adds an incremental `index` starting at 0.

function filterEmptyAndDuplicateChunks() {
  const inputItems   = $input.all();
  const seenContent  = new Set();
  const validChunks  = [];

  for (const item of inputItems) {
    const chunk = item.json;

    /* 1 ── skip empty rows */
    if (!chunk || !chunk.text || chunk.text.trim() === "") continue;

    const titleText   = (chunk.section_title || "").trim();
    const contentText = chunk.text.trim();

    /* 2 ── drop title-only rows */
    if (contentText === titleText) continue;

    /* 3 ── duplicate detection (normalise whitespace + leading numbers) */
    const normalized = contentText
      .replace(/^\d+(\.\d+)*\s+/gm, "")  // remove numbered prefixes
      .replace(/\s+/g, " ")              // collapse whitespace
      .trim();

    if (seenContent.has(normalized)) continue;
    seenContent.add(normalized);

    validChunks.push(chunk);
  }

  /* 4 ── return with incremental index */
  return validChunks.map((chunk, idx) => ({
    json: {
      ...chunk
    }
  }));
}

return filterEmptyAndDuplicateChunks();

/**
 * N8n Function node to split document chunks for optimized Elasticsearch vector search
 * Takes chunks like those extracted from PDF documents and splits them if they exceed token limits
 * while preserving context and section structure
 * 
 * @param {Object} items - The input items coming from n8n workflow
 * @returns {Object} - The processed items with optimized chunks for vector search
 */

// Main processing function for n8n Function node
function processDocumentChunks() {
  // Get input data
  const items = $input.all();

  // Configuration (could be made into node parameters in a custom n8n node)
  const maxTokens = 7000;        // Maximum tokens per chunk
  const overlapTokens = 50;     // Tokens to overlap between chunks
  const embeddingField = 'text_to_embed'; // Field for the text to be embedded

  let outputItems = [];
  let globalChunkIndex = 0;  // Global counter for chunk indexing

  // Process each item
  for (const item of items) {
    let inputChunks;

    // Determine input format
    if (Array.isArray(item.json)) {
      // If input is already an array of chunks
      inputChunks = item.json;
    } else if (item.json.chunks && Array.isArray(item.json.chunks)) {
      // If chunks are in a property called 'chunks'
      inputChunks = item.json.chunks;
    } else {
      // If the item itself is a single chunk
      inputChunks = [item.json];
    }

    // Process the chunks
    const processedChunks = splitChunks(inputChunks, maxTokens, overlapTokens, embeddingField, globalChunkIndex);

    // Update the counter
    globalChunkIndex += inputChunks.length;

    // Return in the same format as received
    if (Array.isArray(item.json)) {
      outputItems.push({ json: processedChunks });
    } else if (item.json.chunks) {
      outputItems.push({
        json: {
          ...item.json,
          chunks: processedChunks
        }
      });
    } else {
      // Return processed chunks as separate items
      processedChunks.forEach(chunk => {
        outputItems.push({ json: chunk });
      });
    }
  }

  return outputItems;
}

/**
 * Split chunks if they exceed the token limit
 * @param {Array} chunks - Array of document chunks
 * @param {number} maxTokens - Maximum tokens per chunk
 * @param {number} overlapTokens - Tokens to overlap between chunks
 * @param {string} embeddingField - Field name for embeddings
 * @param {number} startIndex - Starting index for global chunk indexing
 * @returns {Array} - Processed chunks
 */
function splitChunks(chunks, maxTokens, overlapTokens, embeddingField, startIndex = 0) {
  const result = [];

  // Process each chunk
  chunks.forEach((chunk, index) => {
    const tokenCount = estimateTokens(chunk.text);
    const actualIndex = startIndex + index;

    // If chunk is within token limit, add vector fields and keep it as is
    if (tokenCount <= maxTokens) {
      result.push({
        ...chunk,
        //[embeddingField]: chunk.text, // Add embedding field
        // vector_metadata: {
        //   token_count: tokenCount,
        //   is_split: false,
        // }
      });
      return;
    }

    // Need to split the chunk - first try by paragraphs
    const paragraphs = splitIntoParagraphs(chunk.text);
    let chunkParts = [];

    if (paragraphs.length > 1) {
      // If we have multiple paragraphs, try to group them into chunks
      chunkParts = groupContentUnits(paragraphs, maxTokens, chunk.section_title);
    } else {
      // Otherwise split by sentences
      const sentences = splitIntoSentences(chunk.text);
      chunkParts = groupContentUnits(sentences, maxTokens, chunk.section_title);
    }

    // Create chunk objects for each part
    chunkParts.forEach((part, partIndex) => {
      // Add section title to beginning of parts after the first one
      const textWithContext = partIndex === 0 
        ? part
        : `${chunk.section_title || ''} (continued) ${part}`;

      result.push({
        chunk_id: `${chunk.chunk_id}_part${partIndex + 1}`,
        section_title: chunk.section_title,
        text: textWithContext,
        //[embeddingField]: textWithContext, // Field for embedding
        metadata: {
          ...chunk.metadata,
          parent_chunk_id: chunk.chunk_id,
          is_split_chunk: true,
          split_part: partIndex + 1,
          total_parts: chunkParts.length
        },
        //vector_metadata: {
         // token_count: estimateTokens(textWithContext),
         // is_split: true,
         // part_index: partIndex
       // }
      });
    });
  });

  return result;
}

/**
 * Group content units (paragraphs or sentences) into chunks of appropriate size
 * @param {Array} units - Content units to group
 * @param {number} maxTokens - Maximum tokens per chunk
 * @param {string} sectionTitle - Section title for context
 * @returns {Array} - Grouped content as chunks
 */
function groupContentUnits(units, maxTokens, sectionTitle) {
  const chunks = [];
  let currentChunk = '';
  let currentTokens = 0;
  const contextPrefix = sectionTitle ? sectionTitle + ' ' : '';
  const contextTokens = estimateTokens(contextPrefix);

  // Account for context in parts after the first
  const effectiveMaxTokens = maxTokens - contextTokens;

  units.forEach((unit, index) => {
    const unitTokens = estimateTokens(unit);

    // If this unit alone exceeds limits, split it further by words
    if (unitTokens > effectiveMaxTokens) {
      if (currentChunk) {
        chunks.push(currentChunk);
        currentChunk = '';
        currentTokens = 0;
      }

      // Split large unit by words
      const words = unit.split(/\s+/);
      let tempChunk = '';

      words.forEach(word => {
        const wordTokens = estimateTokens(word + ' ');

        if (currentTokens + wordTokens > effectiveMaxTokens) {
          if (tempChunk) {
            chunks.push(tempChunk);
            tempChunk = word;
            currentTokens = wordTokens;
          } else {
            // Word itself is too big, have to include it anyway
            tempChunk = word;
            currentTokens = wordTokens;
          }
        } else {
          tempChunk += (tempChunk ? ' ' : '') + word;
          currentTokens += wordTokens;
        }
      });

      if (tempChunk) {
        chunks.push(tempChunk);
      }
    }
    // If adding this unit would exceed max tokens, start a new chunk
    else if (currentTokens + unitTokens > effectiveMaxTokens) {
      if (currentChunk) {
        chunks.push(currentChunk);
      }
      currentChunk = unit;
      currentTokens = unitTokens;
    } 
    // Add to current chunk
    else {
      currentChunk += (currentChunk ? ' ' : '') + unit;
      currentTokens += unitTokens;
    }
  });

  // Add any remaining content
  if (currentChunk) {
    chunks.push(currentChunk);
  }

  return chunks;
}

/**
 * Split text into paragraphs
 * @param {string} text - Input text
 * @returns {Array} - Array of paragraphs
 */
function splitIntoParagraphs(text) {
  // Split on double newlines or equivalent
  return text.split(/\n\s*\n|\r\n\s*\r\n/).filter(p => p.trim());
}

/**
 * Split text into sentences
 * @param {string} text - Input text
 * @returns {Array} - Array of sentences
 */
function splitIntoSentences(text) {
  // Split on sentence-ending punctuation followed by space or end of string
  return text.split(/(?<=[.!?])\s+|(?<=[.!?])$/).filter(s => s.trim());
}

/**
 * Estimate token count for a text string
 * @param {string} text - Text to estimate tokens for
 * @returns {number} - Estimated token count
 */
function estimateTokens(text) {
  if (!text) return 0;

  // Simple estimation: roughly 4 characters per token for English
  // For production, replace with a proper tokenizer matching your embedding model
  return Math.ceil(text.length / 4);
}

// Execute the function and return results
return processDocumentChunks();

const input = $json;
