const slug = s => (s ?? "").toLowerCase()
  .replace(/[^a-z0-9]+/g, '_')
  .replace(/^_|_$/g, '')
  .slice(0, 50);

const final = ($input.first()?.json?.data?.chunks ?? []).map((c, i) => {
  const sectionTitle = c?.section_title ?? "";
  const text = c?.text ?? "";
  const chunkIndex = c?.chunk_index ?? "";

  const chunkId = `${slug(sectionTitle)}_${i}`;
  const metadata = {
    ...(c?.metadata ?? {}),
    chunk_index: chunkIndex
  };

  // Remove heading_path if it exists
  if ("heading_path" in metadata) {
    delete metadata.heading_path;
  }

  return {
    section_title: sectionTitle,
    chunk_id: chunkId,
    text: text,
    metadata: metadata
  };
});

return final.map(j => ({ json: j }));

